$(function () {
	window.DEMO.loadCommon();

	$("#clearscreen").on("click", function () {
		doGet("/test/clear");
	});

	$("#getAbout").on("click", function () {
		doGet("/test/about");
	});

	$("#getJson").on("click", function () {
		doGet("/test/json");
	});

	$("#getArray").on("click", function () {
		doGet("/test/array");
	});

	$("#getVersion").on("click", function () {
		doGet("/test/version");
	});

	$("#resizeGif").on("click", function () {
		const json = {
			"base64String": $("textarea#jsonText").val(),
			"width": 150
		}
		doPut("/test/resize-gif", json, true);
	});

	$("#uploadGif").on("click", function () {
		const json = {
			"base64String": $("textarea#jsonText").val(),
			"filename": "testserver.gif"
		}
		doPut("/test/upload-gif", json, true);
	});

	$("textarea#jsonText").val(jsonText);
});

function doGet(url, isAsync) {
	$("textarea#response").val("");
	$.ajax({
		type: "GET",
		url: url,
		dataType: null,
		async: isAsync | true,
		cache: false,
		success: function (data) {
			foo(data);
		},
		error: function (jqXHR) {
			foo(jqXHR.status);
		}
	});
}
; function foo(data) {
	$("textarea#response").val(data);
}
;

// -------------------------------------------------------------------------------------------
// Resizes the gif via an AJAX call.
// url: "http://localhost:3000/test/resize-gif",
// -------------------------------------------------------------------------------------------
function doPut(url, json, isAsync) {
	$.ajax({
		type: "PUT",
		url: url,
		dataType: "json",
		headers: {
			"Content-Type": "application/json"
		},
		global: false,
		async: isAsync || false,
		data: JSON.stringify(json),
		complete: function (jqXHR) {
			if (jqXHR.status === 200) {
				foo(jqXHR.responseText);
			}
		},
		fail: function (err) {
			console.log(err);
		}
	});
}
;

